import React, { Fragment } from "react"
import {childRender} from "../../router/index"
import {NavLink, Switch, Route} from "react-router-dom"
import ChildNav from "../../component/childNav"
function Index(){
    return(
        <Fragment>
            <ChildNav/>
            <Switch>
                {childRender.map(()=>{
                    return(
                        <Route
                            key={item.title}
                            path={item.path}
                            render={(props)=>{
                                return (item.render())
                            }}
                        >

                        </Route>
                    )
                })}
            </Switch>
        </Fragment>
    )
}

export default Index
